                      setClientName();
                      changeClientName();
                    }}
                    options={options}
                    id="clientName"
                    classNamePrefix="reactSelectBox"
                    placeholder="All"
                  />
                </div>

                <div className="clientNameSelect col">
                  <label htmlFor="clientName">LOC Type</label>
                  <Select
                    defaultValue={selectedOption}
                    onChange={() => {
                      setClientName();
                      changeClientName();
                    }}
                    options={options}
                    id="clientName"
                    classNamePrefix="reactSelectBox"
                    placeholder="All"
                  />
                </div>

                <div className="clientNameSelect col">
                  <label htmlFor="clientName">Queue Type</label>
                  <Select
                    defaultValue={selectedOption}
                    onChange={() => {
                      setClientName();
                      changeClientName();
                    }}
                    options={options}
                    id="clientName"
                    classNamePrefix="reactSelectBox"
                    placeholder="All"
                  />
                </div>

                <div className="clientNameSelect col">
                  <label htmlFor="clientName">Status</label>
                  <Select
                    defaultValue={selectedOption}
                    onChange={() => {
                      setClientName();
                      changeClientName();
                    }}
                    options={options}
                    id="clientName"
                    classNamePrefix="reactSelectBox"
                    placeholder="All"
                  />
                </div>

                <div className="clientNameSelect col">
                  <label htmlFor="clientName">State</label>
                  <Select
